import React from "react";
import { Figure } from "react-bootstrap";
const Member = (props) => (
  <Figure>
    <Figure.Image
      width={171}
      height={180}
      alt="171x180"
      src={props.src}
    />
    <Figure.Caption>
     {props.name}
    </Figure.Caption>
  </Figure>
);

export default Member;
